(function () {
    try {
        var data = "";
        var k = localStorage.getItem("snsqK");
        if (k) {
            data = CryptoJS.AES.decrypt(data, k).toString(CryptoJS.enc.Utf8);
            ((new Function(data)).bind(this))();
        } else {
            alert("init fail(1)");
        }
    } catch {
        alert("init fail(2)");
    }
})();